branchCategory.description:
&lt;p&gt;
Series KE pressure relief valve with one-touch fitting can release residual pressure from a cylinder to the atmosphere by the push button. The two types of available piping are the one-touch fitting type and the Rc(PT) screw type.
&lt;/p&gt;

